import styled from "styled-components";

export default function Perguntas(){

    return (
        <Wrapper>
            Perguntas
            <Aberta>cnjke</Aberta>
            <Fechada>kowejf</Fechada>
        </Wrapper>
    )
}

const Wrapper=styled.div`
    background-color: aqua;
`
const Aberta=styled.div`
    width: 300px;
    margin: 12px;
    padding: 15px;
    min-height:100px;
    position: relative;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    background: #FFFFD5;
    box-shadow: 0px 4px 5px rgba(0, 0, 0, 0.15);
    border-radius: 5px;
    font-family: 'Recursive';
    font-style: normal;
    font-weight: 400;
    font-size: 18px;
    line-height: 22px;
    color: #333333;
    &img{
        width: 30px;
        height: 20px;
        bottom: 10px;
        right: 10px;
    }
`

const Fechada=styled.div`
    width: 300px;
    margin: 12px;
    padding: 15px;
    min-height:100px;
    background: #FFFFFF;
    box-shadow: 0px 4px 5px rgba(0, 0, 0, 0.15);
    border-radius: 5px;
    font-family: 'Recursive';
    font-style: normal;
    font-weight: 400;
    font-weight: 700;
    font-size: 16px;
    line-height: 19px;
    color: #333333;
    &img{
        width: 23px;
        height: 23px;
    }
`
